import React, {Fragment} from 'react';
import Navigation from './Navigation';


const Programmation = () => {

    const Rien = () =>{
        return(
            <div>Salut</div>
        )
    }
    return(
        <Fragment>
            <Navigation />
            <select name="" id="">
                <option value="1" onClick={Rien}>1</option>
                <option value="2">2</option>
                <option value="3">3</option>
                <option value="4">4</option>
            </select>
        </Fragment>
    )
}

export default Programmation
